import React from 'react';
import SerreData from './SerreData';

const serres = [
  { id: 1 },
  { id: 2 },
  { id: 3 },
  { id: 4 },
]

function Data() {
  return (
    <div>
      {serres.map((serre) => (
        <SerreData number={serre.id}/>
      ))}
    </div>
  );
}

export default Data;
